    __webpack_exports__["default"] = "<app-commonheader></app-commonheader>\n<div class=\"flat-about pd-about clearfix\">\n    <div class=\"container\">\n        <div class=\"row\">\n            <div class=\"col-lg-6\">\n                <div class=\"textbox-about\">\n                    <div class=\"title-section\">\n                        <div class=\"flat-title medium heading-type18\">\n                            Canvas Stretching\n                        </div>\n                    </div>\n                    <div class=\"textbox-content\">\n                        <div class=\"about-introduce\">\n                            In addition to our deep knowledge in quality archival framing, design, and restoration, we\n                            also offer superior service\n                            in canvas stretching to all the Bay Area. Whether you bring us Belgian lenin or duck canvas,\n                            with over 30 years of\n                            experience stretching an endless variety of material, we can assure that your art will be\n                            stretched with both a gentle\n                            touch and pinpoint accuracy.<br><br>\n\n                            “The word canvas is derived from the Latin word “cannabis” and has existed as a fabric since\n                            ancient times. Canvas can\n                            be composed of hemp, flax or cotton. The flax plant is the source of linen. The fibers of\n                            linen are round and give the\n                            fabric and irregular texture and therefore a very natural and random look that is highly\n                            prized by artists. The natural\n                            presence of linseed oil in the plant preserves the fibers and keeps them flexible. Canvases\n                            composed of hemp and of\n                            linen are virtually indistinguishable from each other with the naked eye but since linen was\n                            the more costly of the two\n                            due to the difficulty of processing it, hemp was quite popular among artists for whom cost\n                            mattered until the end of the\n                            18th century.<br><br>\n\n                            The increasing use of canvas in the last few centuries has had a significant impact on\n                            painting as an art form. The\n                            portability of a painting executed on canvas freed painters to work in the comfort of their\n                            studios or even out of doors\n                            instead of at the final destination of the work of art, as with mural painting. Large\n                            canvasses were more easily\n                            transported and mounted than large wooden panels. In addition, the discontinuity caused by\n                            the need to paint around or\n                            over architectural structures within a room gave way to a powerful unity of theme provided\n                            by the rectangular shape of\n                            stretched canvas.” -Diana Blake\n                        </div>\n                    </div>\n                </div>\n            </div>\n            <br>\n            <div class=\"col-lg-6 mx-auto text-center\">\n                <img src=\"../../assets/images/blog/01.png\">\n                <img src=\"../../assets/images/blog/01.png\">\n                <img src=\"../../assets/images/blog/01.png\">\n            </div>\n        </div>\n    </div>\n</div>";
